/* @flow */
import * as React from 'react'
import classnames from 'classnames'

import styles from './style.css'

type Props = {
  children?: React.Node,
  className?: string,
  image: string,
}

const Header = (props: Props): React.Element<*> => (
  <div
    className={classnames(styles.feature, props.className)}
  >
    {props.children}
  </div>
)

Header.defaultProps = {
  className: undefined,
  children: undefined,
  image: '',
}

export default Header
